import 'dart:async';
import 'dart:convert';
import 'dart:typed_data';
import 'dart:ui' as ui;

/// Test image class
class TestImageV2 {
  /// return image
  static Future<ui.Image> loadImage() async {
    const base64ImageData =
        ''; // Replace this with your base64-encoded image data
    final Uint8List imageBytes = base64.decode(base64ImageData);
    final Completer<ui.Image> completer = Completer();
    ui.decodeImageFromList(imageBytes, completer.complete);
    return completer.future;
  }
}
